import React from 'react';

function List(props) {
  return(
    <ul>
      {props.people.map(person => (
        <li key={person.name}>{person.name}</li>
      ))}
    </ul>
  );
}

function App() {
  const people1 = [
    {
      name: 'Sonny'
    },
    {
      name: 'Fiko'
    },
    {
      name: 'Vinsen'
    }
  ]
  const people2 = [
    {
      name: 'Lippo'
    },
    {
      name: 'Reza'
    },
    {
      name: 'Ragum'
    }
  ]
  return (
    <div className="App">
      <h1>React People</h1>
      <List people={people1} />
      <List people={people2} />
    </div>
  );
}

export default App;
